import React from 'react';
import { FormControl } from '@mui/material';

import InputLabel from '@mui/material/InputLabel';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';

const optionsRadius = [
  { id: '1', label: '50 см' },
  { id: '2', label: '50 см' },
  { id: '3', label: '50 см' },
  { id: '4', label: '50 см' },
  { id: '5', label: '50 см' },
  { id: '6', label: '50 см' },
];
export default function SelectRad() {
  const [radius, setRadius] = React.useState('');
  const [selectedRad, setSelectedRad] = useState('');

  const handleRadChange = (event) => {
    setSelectedRad(event.target.value);
  };

  const handleChangeRadius = (event) => {
    setRadius(event.target.value);
  };
  return (
    <FormControl sx={{ m: 1, minWidth: 120 }} size='small'>
      <InputLabel id='demo-select-small-label'>Диаметр</InputLabel>
      <Select
        labelId='demo-select-small-label'
        id='demo-select-small'
        value={radius}
        label='Age'
        onChange={handleChangeRadius}
        sx={{ width: '120px' }}
      >
        {optionsRadius.map(({ id, label }) => (
          <MenuItem key={id} value={id}>
            {label}
          </MenuItem>
        ))}
      </Select>
    </FormControl>
  );
}
